Ladyboys

Culture, Health-Medical Documentary hosted by Kate McEnery, published by BSkyB in 2012 - English narration


Information
------------------------------

Ladyboys
Following last year's successful documentary exploring the world of Thailand's ladyboys, this new thought-provoking series offers further insight into a sector of Thai society that makes up one per cent of the country's population. This revealing documentary explores the world of transsexuals in Thailand, and follows two Americans who travel to Bangkok for sex change surgery, and a British ex-pat looking for love.


1)  Celebrity Ladyboys 
Following the stories of Thai transsexuals who have risen to fame. Belle is about to release a debut single after revealing her true identity on a talent show, and Poy won the transgender equivalent of Miss World. Business owner Nok reveals how hard it can be for transgender individuals to be accepted in the eyes of the law, and now campaigns for change.


